measurements.description:
Fourteen flowers on one 65.7-cm inflorescence;

sepals and petals yellow overlaid chartreuse, stippled burgundy, sepals oblanceolate, petals lanceolate;

lip white, overlaid burgundy basally, boldly spotted dark burgundy, overlaid yellow centrally, keels yellow spotted burgundy;


column cream overlaid burgundy dorsal aspect, spotted burgundy verntral aspect, anther cap white;
substance firm; texture satiny.
